// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './components/HomePage';
import DistrictCourtPage from './components/DistrictCourt';
import HighCourtPage from './components/HighCourt';
import SupremeCourtPage from './components/SupremeCourt';
import CourtOption from './components/CourtOptions'; // Import CourtOption
import ViewJudgment from './components/ViewJudgment'; // New component for View Judgment
import UploadJudgment from './components/UploadJudgment'; // New component for Upload Judgment

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/district" element={<DistrictCourtPage />} />
        <Route path="/high" element={<HighCourtPage />} />
        <Route path="/supreme" element={<SupremeCourtPage />} />
        <Route path="/court-option" element={<CourtOption />} /> {/* Add new route for CourtOption */}
        <Route path="/view-judgment" element={<ViewJudgment />} /> {/* Add route for View Judgment */}
        <Route path="/upload-judgment" element={<UploadJudgment />} /> {/* Add route for Upload Judgment */}
      </Routes>
    </Router>
  );
}

export default App;
